import ShowSearchedMovie from "./ShowSearchedMovie";
import { useState,Fragment } from "react";
import AddMovie from './AddMovie';

const ShowSearchedMovies = props => {
    const [addMovie, setAddMovie] = useState(false)
    const ClickHandler = (id) => {
        setAddMovie(true);
    };

    // if(props.results){
    // props.results.forEach(element => {
    //     console.log(element.id)
    //     console.log(element.title)
    //     console.log(element.description)
    //     console.log(element.image)
    // });
    // }
    return (
        <Fragment>
        {!addMovie &&
        <div>
            <div id="body" className="home">
                <div>
                    <ul>
                        {props.results.map((movie) => (
                            // <ShowSearchedMovie
                            //     id={movie.id}
                            //     title={movie.title}
                            //     description={movie.description}
                            //     image={movie.image}
                            // />
                            <div >
                                <li>
                                    {/* {console.log(movie)} */}
                                    <p style={{ color: "white", marginLeft: "20px", alignContent: "center" }}>{movie.title}</p> 
                                    <p style={{ color: "white", marginLeft: "20px", alignContent: "center" }}>{movie.description}</p> 
                                    <img
                                        style={{ height: "280px", width: "241px" }}
                                        src={movie.image} alt="" />
                                    <br />
                                    <button onClick={ClickHandler("111")} style={{ width: "100px", marginLeft: "60px", marginBottom: "30px", marginTop: "20px" }}>Add</button>
                                </li>
                            </div >
                        ))}
                    </ul>
                </div>
            </div>
        </div>
        }
        {addMovie && <AddMovie />}
        </Fragment>
    );
};

export default ShowSearchedMovies;
